import React from "react";
import TournamentForm from "../components/Form/form";

function Home() {
  return (
    <div classname="home">
      <div class="container">
        <div class="row align-items-center my-5">
          <div class="col-lg-7">
            <TournamentForm/>
          </div>
        </div>
      </div>
    </div>
  );
}

